    for i in range(n):
        dp[i][i] = 1
    for i in range(n-1, -1, -1):
        for j in range(i+1, n):
            dp[i][j] = (dp[i+1][j] + dp[i][j-1]) % (10**9 + 7)
    for _ in range(t-1):
        new_dp = [[0]*n for _ in range(n)]
        for i in range(n):
            for j in range(n):
                for x in range(i, j+1):
                    new_dp[i][j] += dp[i][x] * dp[x+1][j]
                    new_dp[i][j] %= (10**9 + 7)
        dp = new_dp
    ans = 0
