    n, m = f()
    adj = [[] for _ in range(n+1)]
    for _ in range(m):
        a, b = f()
        adj[a].append(b)
        adj[b].append(a)
    def dfs(node, visited, depth):
        if node in visited:
            return depth
        visited.add(node)
        max_depth = 0
        for neighbor in adj[node]:
            if neighbor not in visited:
                max_depth = max(max_depth, dfs(neighbor, visited, depth+1))
        return max_depth
