    dp = [[float('inf')] * len(dungeon[0]) for _ in range(len(dungeon))]

    # Set the bottom-right cell to 1, since the knight can't move any further
    dp[-1][-1] = 1

    # Iterate over the dungeon from right to left and bottom to top
    for i in range(len(dungeon) - 1, -1, -1):
        for j in range(len(dungeon[0]) - 1, -1, -1):
            # If the current cell is empty, set the dp value to the minimum of the down and right cell
            if dungeon[i][j] == 0:
                if i < len(dungeon) - 1:
                    dp[i][j] = min(dp[i+1][j], dp[i][j+1])
            # If the current cell contains a power-up, set the dp value to the current value plus the power-up
            else:
                dp[i][j] = dungeon[i][j]

            # If the current cell contains a demon, set the dp value to the minimum of the down and right cell plus the health loss
            if dungeon[i][j] < 0:
                if i < len(dungeon) - 1:
                    dp[i][j] = min(dp[i+1][j] - dungeon[i][j], dp[i][j+1] - dungeon[i][j])

    return dp[0][0]

