    graph = [[] for _ in range(n+1)]
    for u, v in edges:
        graph[u].append(v)
        graph[v].append(u)
    def dfs(node, visited, path):
        visited.add(node)
        path.append(node)
        for neighbor in graph[node]:
            if neighbor not in visited:
                dfs(neighbor, visited, path)
    cycles = 0
    for i in range(1, n+1):
        if i not in visited:
            path = []
            dfs(i, set(), path)
            if len(path) > 2 and path[0] == path[-1]:
                cycles += 1
    return cycles

